    render(){
        return(
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Box sx={{width: 500, height: 500, color: 'secondary'}}></Box>
                </Grid>
                <Grid item xs={6}>
                    
                </Grid>
            </Grid>
        )
    }
}
